import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const strArray = `
    var strArray = "StackOverflow".split("");

    console.log(strArray)
    console.log(strArray.join(""));
`.trim();

const Sort = `
let i, j, arr=[0,9,8,7,6];
var max=0;

for(i=0; i<arr.length; i++){
  for(j=i; j<arr.length; j++){
    if(arr[i]>arr[j]){
      var temp=arr[i];
      arr[i]=arr[j];
      arr[j]=temp;
    }
  }
}

console.log(arr);


//Greatest Product Of 3
max = arr[arr.length-1] * arr[arr.length-2] * arr[arr.length-3]
console.log(max);
`.trim()

const duplicates = `
var array = [1,2,3,4,3,0,9,0,1];
var result=[];

for(let i=0; i<array.length;i++){
    let count=0;
    for(let j=0;j<result.length;j++){
        if(array[i]==result[j]){
            count +=1;
        }
    }
    if(count==0){
        result.push(array[i]);
    }  
}
console.log(result) `.trim()

const removeElement = `
const removeElement = function (nums, val) {
  let left = 0
  const swap = (a, b) => {
    const temp = nums[a]
    nums[a] = nums[b]
    nums[b] = temp
  }
  while (left <= nums.length - 1) {
    while (nums[nums.length - 1] === val) {
      nums.pop()
    }
    while (nums[left] !== val && left <= nums.length - 1) {
      left += 1
    }

    if (left < nums.length - 1) {
      swap(left, nums.length - 1)
      left += 1
      nums.pop()
    }
  }
  return nums.length
}


console.log(removeElement([0,1,2,2,3,0,4,2],1))`.trim();

const searchRange = `
const searchRange = (nums = [], target) => {
  const binarySearch = (left, right, position = 'middle') => {
    let pivot = -1
    while (left <= right) {
      const middle = Math.floor((left + right) / 2)
      if (nums[middle] === target) {
        if (position === 'middle') {
          pivot = middle
          break
        } else if (position === 'left') {
          pivot = middle
          right = middle - 1
        } else if (position === 'right') {
          pivot = middle
          left = middle + 1
        }
      } else if (nums[middle] < target) {
        left = middle + 1
      } else {
        right = middle - 1
      }
    }
    return pivot
  }


  const pivot = binarySearch(0, nums.length - 1, 'middle')
  return [
    binarySearch(0, pivot, 'left'),
    binarySearch(pivot, nums.length - 1, 'right'),
  ]
}

console.log(searchRange([5,7,7,8,8,10],6))`.trim();

const searchInsert = `
const searchInsert = (nums, target) => {
  const aux = (low, high) => {
    if (low > high) {
      return low
    }
    const middle = Math.floor((low + high) / 2)
    if (target === nums[middle]) {
      return middle
    } if (target > nums[middle]) {
      return aux(middle + 1, high)
    }
    return aux(low, middle - 1)
  }
  return aux(0, nums.length - 1)
}

console.log(searchInsert([1,3,5,6], 5))`.trim();

const isValidSudoku = `
const isValidSudoku = (board = []) => {
  const rows = []
  const columns = []
  const boxes = []

  for (let i = 0; i < board.length; i++) {
    for (let j = 0; j < board[i].length; j++) {
      const content = board[i][j]
      if (content !== '.') {
        if (!rows[i]) {
          rows[i] = {}
        }
        if (rows[i][content]) {
          return false
        }
        rows[i][content] = 1

        if (!columns[j]) {
          columns[j] = {}
        }
        if (columns[j][content]) {
          return false
        }
        columns[j][content] = 1
        const boxNum = Math.floor(i / 3) * 3 + Math.floor(j / 3)
        if (!boxes[boxNum]) {
          boxes[boxNum] = {}
        }
        if (boxes[boxNum][content]) {
          return false
        }
        boxes[boxNum][content] = 1
      }
    }
  }
  return true
}

console.log(isValidSudoku([
  ["5","3",".",".","7",".",".",".","."],
  ["6",".",".","1","9","5",".",".","."],
  [".","9","8",".",".",".",".","6","."],
  ["8",".",".",".","6",".",".",".","3"],
  ["4",".",".","8",".","3",".",".","1"],
  ["7",".",".",".","2",".",".",".","6"],
  [".","6",".",".",".",".","2","8","."],
  [".",".",".","4","1","9",".",".","5"],
  [".",".",".",".","8",".",".","7","9"]
]))`.trim();

const combinationSum = `
var combinationSum = function(candidates, target) {
  const result = []
  const aux = (start,current=[], sum = 0) => {
      if(sum > target) {
          return 
      }
      if(sum === target) {
          result.push(current)
          return
      }
      for(let i = start; i < candidates.length; i++) {
          aux(i, [...current, candidates[i]], sum+candidates[i])
      }
  }
  for(let i = 0; i <  candidates.length; i++) {
      aux(i, [candidates[i]], candidates[i])
  }
  return result
};

console.log(combinationSum([2,3,5],8))`.trim();

const firstMissingPositive = `
const firstMissingPositive = (nums = []) => {
  const swap = (a, b) => {
    const temp = nums[a]
    nums[a] = nums[b]
    nums[b] = temp
  }
  let index = 0
  while (index < nums.length) {
    if (
      nums[index] !== nums[nums[index] - 1]
      && nums[index] > 0
      && nums[index] <= nums.length
    ) {
      swap(index, nums[index] - 1)
    } else {
      index += 1
    }
  }
  for (let i = 0; i < nums.length; i++) {
    if (nums[i] !== i + 1) {
      return i + 1
    }
  }
  return nums.length + 1
}

console.log(firstMissingPositive([3,4,-1,1]))`.trim();

const addStrings = `
const addStrings = (num1, num2) => {
  const reversedNum1 = num1.split('').reverse()
  const reversedNum2 = num2.split('').reverse()
  const { shorter, longer } = reversedNum1.length < reversedNum2.length
    ? { shorter: reversedNum1, longer: reversedNum2 }
    : { shorter: reversedNum2, longer: reversedNum1 }

  let rem = 0
  let result = longer.reduce((acc, digit1, index) => {
    const total = parseInt(digit1, 10) + (parseInt(shorter[index], 10) || 0) + rem
    if (total >= 10) {
      rem = 1
    } else {
      rem = 0
    }
    return [
      ...acc,
      total >= 10 ? total - 10 : total,
    ]
  }, [])
  result = rem === 1 ? [...result, rem] : result
  return result.reverse().join('')
}

const zero = (count) => {
  let result = ''
  while (count >= 1) {
    result += '0'
    count -= 1
  }
  return result
}
const multiply = (num1 = '', num2 = '') => {
  let result = 0
  for (let i = num2.length - 1; i >= 0; i--) {
    let current = ''
    let base = 0
    for (let j = num1.length - 1; j >= 0; j--) {
      let currentResult = parseInt(num1[j], 10) * parseInt(num2[i], 10) + base
      if (currentResult >= 10) {
        base = Math.floor(currentResult / 10)
        currentResult -= base * 10
      } else {
        base = 0
      }
      current = '$'{currentResult + current}'
    }
    if (base > 0) {
      current = base + current
    }
    // 偷懒
    result = addStrings(result || '0', current + zero(num2.length - 1 - i))
  }
  if (result.length > 0 && result[0] === '0') {
    return '0'
  }
  return result
}


console.log(addStrings("2","3"))`.trim();

const jump = `
const jump = (nums = []) => {
  let steps = 0
  let currentJumpIndex = 0
  let nextJumpIndex = 0
  for (let i = 0; i < nums.length - 1; i++) {
    nextJumpIndex = Math.max(i + nums[i], nextJumpIndex)
    if (i === currentJumpIndex) {
      steps += 1
      currentJumpIndex = nextJumpIndex
    }
  }
  return steps
}


console.log(jump([2,3,1,1,4]))`.trim();

const permute = `
const permute = (nums = []) => {
  const result = []
  const aux = (list = [], current = []) => {
    if (list.length === 0) {
      result.push(current)
    }
    list.forEach((number, index) => {
      aux(list.filter((v, index2) => index2 !== index), [...current, number])
    })
  }
  aux(nums)
  return result
}


console.log(permute([1,2,3]))`.trim();


class DSLogic2 extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0)
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4><Sidebar /></h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
            <h3>3. Convert a string to an array</h3>
              <div style={titles}>
                <PrismCode
                  code={strArray}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />

              <h3>4. Sort</h3>
              <div style={titles}>
                <PrismCode
                  code={Sort}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />

              <h3>7. Remove Duplicates</h3>
              <div style={titles}>
                <PrismCode
                  code={duplicates}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />



              <h3>1. Remove Element</h3>
              Given an array nums and a value val, remove all instances of that value in-place and return the new length.
              <br/>
Do not allocate extra space for another array, you must do this by modifying the input array in-place with O(1) extra memory.
<br/>
The order of elements can be changed. It doesn't matter what you leave beyond the new length.
<br/><br/>
Example 1:<br/>

Given nums = [3,2,2,3], val = 3,<br/>
Your function should return length = 2, with the first two elements of nums being 2.<br/>
It doesn't matter what you leave beyond the returned length.
              <div style={titles}>
                <PrismCode
                  code={removeElement}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>3. Find First and Last Position of Element in Sorted Array</h3>
              Given an array of integers nums sorted in ascending order, find the starting and ending position of a given target value.
              <br/>
Your algorithm's runtime complexity must be in the order of O(log n).<br/>

If the target is not found in the array, return [-1, -1].<br/>

Example 1:
<br/>
Input: nums = [5,7,7,8,8,10], target = 8<br/>
Output: [3,4]<br/><br/>
Example 2:<br/>

Input: nums = [5,7,7,8,8,10], target = 6<br/>
Output: [-1,-1]
              <div style={titles}>
                <PrismCode
                  code={searchRange}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>4. Search Insert Position.</h3>
              Given a sorted array and a target value, return the index if the target is found. If not, return the index where it would be if it were inserted in order.
              <br/>
              Input: [1,3,5,6], 5<br/>
Output: 2<br/><br/>
Example 2:<br/>

Input: [1,3,5,6], 2<br/>
Output: 1
              <div style={titles}>
                <PrismCode
                  code={searchInsert}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>5. Valid Sudoku.</h3>
              Determine if a 9x9 Sudoku board is valid. Only the filled cells need to be validated according to the following rules:
              <br/><br/>
Each row must contain the digits 1-9 without repetition.<br/>
Each column must contain the digits 1-9 without repetition.<br/>
Each of the 9 3x3 sub-boxes of the grid must contain the digits 1-9 without repetition.<br/><br/>
<b>Note: </b>
A Sudoku board (partially filled) could be valid but is not necessarily solvable.<br/>
Only the filled cells need to be validated according to the mentioned rules.<br/>
The given board contain only digits 1-9 and the character '.'.<br/>
The given board size is always 9x9.
              <div style={titles}>
                <PrismCode
                  code={isValidSudoku}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>6. Combination Sum</h3>
              Input: candidates = [2,3,6,7], target = 7,<br/>
A solution set is:<br/>
[<br/>
  [7],<br/>
  [2,2,3]<br/>
]
              <div style={titles}>
                <PrismCode
                  code={combinationSum}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>7. First Missing Positive</h3>
              Input: [3,4,-1,1]<br/>
Output: 2
              <div style={titles}>
                <PrismCode
                  code={firstMissingPositive}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>8. Multiply Strings</h3>
              Input: num1 = "2", num2 = "3" <br/>
Output: "6"
              <div style={titles}>
                <PrismCode
                  code={addStrings}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>9. Jump Game</h3>
              Given an array of non-negative integers, you are initially positioned at the first index of the array.
              <br/>
Each element in the array represents your maximum jump length at that position.<br/>

Your goal is to reach the last index in the minimum number of jumps.<br/><br/>
Input: [2,3,1,1,4]<br/>
Output: 2<br/>
Explanation: The minimum number of jumps to reach the last index is 2.
    Jump 1 step from index 0 to 1, then 3 steps to the last index.<br/><br/>
    <b>N: </b>You can assume that you can always reach the last index.
              <div style={titles}>
                <PrismCode
                  code={jump}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br/>

              <h3>10. Permutations.</h3>
              Given a collection of distinct integers, return all possible permutations.
              <div style={titles}>
                <PrismCode
                  code={permute}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
            </List>
          </Paper>
        </Grid>
      </Grid>
    )
  }
}

export default (withStyles(styles)(DSLogic2));
